                </Row>
                <Row className="justify-content-center">
                    <Col md={4}>
                        {/* Ülejäänud kood siin */}
                    </Col>
                    <Col md={4}>
                        {/* Ülejäänud kood siin */}
                    </Col>
                </Row>
            </div>

            <Row>
                {products.map((product) => (
                    <Col key={product._id} sm={12} md={4} lg={4} xl={4}>
                        <Product product={product} />
                    </Col>
                ))}
            </Row>
        </>
    );
};

export default HomeScreen;
